import Login from './Login';
import React, { useState } from 'react';
import ThumbUp from '@material-ui/icons/ThumbUp';

function Circle() {
  const diameter = useState(300)
  return (
    <div style={{width:diameter,height:diameter,borderRadius:150,borderWidth:3,backgroundColor:"red",display:"flex",flexDirection:"column",justifyContent:"center",alignItems:"center"}}>
        <ThumbUp style={{width:100,height:100}}/>
        <div style={{fontSize:20}}>Create a Policy</div>
    </div>
  );
}

export default Circle;
